import React from "react";
import { Route, Routes } from "react-router-dom";
import LayoutIndex from "../layout";

export default function AppRoutes() {
    return(
        <Routes>
            <Route path="/" element={<LayoutIndex />}>
                <Route index />
            </Route>
        </Routes>
    )
}
